import React from 'react';
import { PortfolioSection } from '../data/Portfolio';
import Card from './Card';

const Portfolio: React.FC = () => {
  return (
    <section>
        {PortfolioSection.map((section, index) => (
            <Card key={index}/>
        ))}
    </section>
  )
}

export default Portfolio;
